import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faFacebookF, faTwitter, faInstagram } from '@fortawesome/free-brands-svg-icons';

const Header = () => {
  return (
    <header className="bg-secondary text-white p-4">
      <div className="container mx-auto flex justify-between items-center">
      <img src={logo} className="App-logo" alt="logo" />
        <div className="text-2xl font-bold">
          <a href="/" className="text-primary">
            MyLogo
          </a>
        </div>

        {/* Menu */}
        <nav className="hidden md:flex space-x-8 font-sans">
          <a href="#home" className="hover:text-primary">Home</a>
          <a href="#about" className="hover:text-primary">About</a>
          <a href="#services" className="hover:text-primary">Services</a>
          <a href="#contact" className="hover:text-primary">Contact</a>
        </nav>

        {/* Redes Sociales */}
        <div className="flex space-x-4">
          <a href="https://facebook.com" className="hover:text-primary">
            <FontAwesomeIcon icon={faFacebookF} />
          </a>
          <a href="https://twitter.com" className="hover:text-primary">
            <FontAwesomeIcon icon={faTwitter} />
          </a>
          <a href="https://instagram.com" className="hover:text-primary">
            <FontAwesomeIcon icon={faInstagram} />
          </a>
        </div>

        {/* Menú móvil */}
        <div className="md:hidden">
          <button className="text-primary focus:outline-none">
            <FontAwesomeIcon icon="bars" />
          </button>
        </div>
      </div>
    </header>
  );
};

export default Header;
